import { useEffect, useState } from "react";
import { Product } from "../../../shared/types";

const useProduct = (id: number = 0) => {
  const [product, setProduct] = useState<Product>();

  useEffect(() => {}, [id]);

  return {
    product,
  };
};

export default useProduct;
